INSERT INTO `ar_article` VALUES ('1', '3', 'Java', '1353259235236756534', '受脑认知和神经科学启发的人工智能', '大概描', 'https://ss3.bdstatic.com/70cFv8Sh_Q1YnxGkpoWK1HF6hhy/it/u=1229855747,4092679124&fm=26&gp=0.jpg', 20190129194744, 1564842743288, 1, 1, 25, 3562, 11, 1, '1', '1', 3.0, '1', 1, '### 试试第一条文章\n![IMG_0610.JPG](data:image/jpeg;base64,)');
INSERT INTO `ar_article` VALUES ('1125040614373310466', '1', '言情,假的', NULL, '第三个文章哦', '第三个文章哦', NULL, 1557065559366, 1557065559366, 0, 1, 0, 0, 0, 1, NULL, NULL, 0.0, NULL, 2, '<p>第三个文章哦</p>');
INSERT INTO `ar_article` VALUES ('1157221525755600897', '1', 'asdasd,asd,asd,标签意', NULL, '测试第一条文章标题', '测试第一条文章描述', NULL, 1564738086518, 1564738086518, 0, 1, 0, 0, 0, 2, NULL, NULL, 0.0, NULL, 3, '<h2>前言</h2>\n<p>最近在搭建spring cloud项目的时候用到了Eureka注册中心，所以要有生产者和消费者的概念，所以在生产者启动类上要加一个服务发现的注解，但是在网上看代码教程的时候发现有两个不一样的注解，实现的是同一个功能，所以在网上找了下@EnableEurekaClient与@EnableDiscoveryClient区别。</p>\n<p>&nbsp;</p>\n<h2>区别</h2>\n<blockquote>\n<p>spring cloud中discovery service有许多种实现（eureka、consul、zookeeper等等），@EnableDiscoveryClient基于spring-cloud-commons, @EnableEurekaClient基于spring-cloud-netflix。<br />其实用更简单的话来说，就是如果选用的注册中心是eureka，那么就推荐@EnableEurekaClient，如果是其他的注册中心，那么推荐使用@EnableDiscoveryClient。</p>\n</blockquote>');
